  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Agassiz
  National Wildlife Refuge summarizes refuge activities during the fiscal year 2004.
  \ The report begins with an introduction to the refuge and a summary of the yearu2019s
  highlights and climatic conditions.  Information about monitoring and studies- including
  wolf and bald eagle studies is provided next.  Habitat restoration and management
  projects are also covered; activities include upland and wetland restoration, prescribed
  fires, and pest plant control.  Fish and wildlife management is discussed next with
  emphasis on bird banding and predator control.  Coordination activities, such as
  easement and watershed are outlined.  The resource protection section provides information
  about law enforcement, water rights, land acquisition, and wilderness areas.  Information
  about public education and recreation is given including visitor services and refuge
  visitation.  Finally, refuge planning and administration are discussed.\",\n\t\"license_title\":
